import "./sidebar.css";
import logoUv from "../../assets/images/UVLogo.png";

const Sidebar = () => {
  return (
    <>
      <div className="sidebar">
        <div className="header">
          <img className="img" src={logoUv} />
        </div>
      </div>
    </>
  );
};

export default Sidebar;
